var handleCountDownTimer=function(){"use strict";var n=new Date,s=n.getFullYear()+1;$("#countdown").countdown(s+"/09/01",function(n){$(this).html(n.strftime('<div class="countdown-col"><div class="countdown-number"><span class="number">%d</span></div><div class="countdown-text">days</div></div><div class="countdown-col"><div class="countdown-number"><span class="number">%H</span></div><div class="countdown-text">hour</div></div><div class="countdown-col"><div class="countdown-number"><span class="number">%M</span></div><div class="countdown-text">minutes</div></div><div class="countdown-col"><div class="countdown-number"><span class="number">%S</span></div><div class="countdown-text">second</div></div>'))})},PageDemo=function(){"use strict";return{init:function(){handleCountDownTimer()}}}();